			if(!dir.exists()){
				dir.mkdirs()
		}
		def file = new File(filePath + fileName  )
		if ( file == null || file.createNewFile()) {
			def base64 = context.expand ('${#TestSuite#signServiceUrl}')+'smev/base64Encode?fileName='+fileName
			def fos = new FileOutputStream(filePath +fileName)
